I was poking around and getting more familiar with our move to WebDriver. My logic may not be sound, however I noticed 10 seconds was hard coded in <code>page.py</code>. I remedied this with the simple addition of self.timeout.
### Old code

``` python
@property
def is_the_current_page(self):
    if self._page_title:
        WebDriverWait(self.selenium, 10).until(lambda s: self.selenium.title)
```
### Remedy

``` python
self.timeout = testsetup.timeout

@property
def is_the_current_page(self):
    if self._page_title:
        WebDriverWait(self.selenium, self.timeout).until(lambda s: self.selenium.title)
```

